import React from 'react'
import style from '../../styles/Heading.module.css'

function SpecialHeading() {
  return (
    <div className={style.Heading}>
      <h4>SPECIAL</h4>
      <p>부대시설 안내 및 서비스</p>
    </div>
  )
}

export default SpecialHeading
